import React, { PureComponent } from "react";
import { Chart } from "react-google-charts";
import Card from "pnnl-react-core/lib/Card";

class LCSGoogleGraph extends PureComponent {
  constructor(props) {
    super(props);
    var lcs = this.props.data;

    this.data = [
      ["Huebin-Angle", "Local-Chroma Shift", { role: "style" }],
      ["Huebin 1", lcs[0], "#b45c60"],
      ["Huebin 2", lcs[1], "#cb7761"],
      ["Huebin 3", lcs[2], "#cb824b"],
      ["Huebin 4", lcs[3], "#d7ad67"],
      ["Huebin 5", lcs[4], "#ac9a5d"],
      ["Huebin 6", lcs[5], "#919E60"],
      ["Huebin 7", lcs[6], "#678B5F"],
      ["Huebin 8", lcs[7], "#62B08F"],
      ["Huebin 9", lcs[8], "#7CBABA"],
      ["Huebin 10", lcs[9], "#2C797D"]
    ];

    //this.data = [

    //]
  }

  render() {
    return (
      <Card>
        <Chart
          width={"800px"}
          height={"300px"}
          chartType="Bar"
          loader={<div>Loading Chart</div>}
          data={this.data}
          options={{
            chart: {
              title: "Company Performance",
              subtitle: "Sales, Expenses, and Profit: 2014-2017"
            }
          }}
          // For tests
          rootProps={{ "data-testid": "4" }}
        />
      </Card>
    );
  }
}

export default LCSGoogleGraph;
